export function getSplGovernanceErrorMessage(code: SplGovernanceError): string {
  if (true) {
    return splGovernanceErrorMessages![code];
  }

  return "Error message not available in production bundles.";
}

export function isSplGovernanceError<
  TProgramErrorCode extends SplGovernanceError,
>(
  error: unknown,
  transactionMessage: {
    instructions: Record<number, { programAddress: Address }>;
  },
  code?: TProgramErrorCode,
): error is SolanaError<typeof SOLANA_ERROR__INSTRUCTION_ERROR__CUSTOM> &
  Readonly<{ context: Readonly<{ code: TProgramErrorCode }> }> {
  return isProgramError<TProgramErrorCode>(
    error,
    transactionMessage,
    SPL_GOVERNANCE_PROGRAM_ADDRESS,
    code,
  );
}
